import React from 'react';
import { Row, Col, Container } from "react-bootstrap";
import Grid from '@material-ui/core/Grid';
import {Button} from 'react-bootstrap';



const Lending = (() =>{

    return (
<div>
<div className='bg'> 
<Grid container spacing={3}>
<Grid className='center' item sm={12}>
    <Row className="mt-2">
    <Col lg={12} sm={12} xs={12} md={12}>
  


  
  <div className='logohome'> Ресторан быстрого обслуживания </div>
  <div className='textone'> Место, где готовят с душой </div>
  <Link to="/shop">
  <Button className='menubtn1'  variant={"outline-light"} 
     style= {{color: '#fd7e14'}} 
      > 

      Меню
      
      </Button>
      </Link>

     

   
   </Col> 
   </Row>
   </Grid>
   <Grid className='center' item sm={12}>
   <div className='cont'>
<Row className="mt-2">
<Col lg={12} sm={12} xs={12} md={12}>

</Col>
</Row>
</div>
</Grid>
</Grid>
   
   </div>

</div>

);
});

export default Lending;
